import React, { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import "./CartPage.css";

const CartPage = () => {
  const navigate = useNavigate();
  const [cart, setCart] = useState([]);
  const [loading, setLoading] = useState(true);

  // Lấy giỏ hàng từ server
  const fetchCart = async () => {
    try {
      const res = await axios.get("http://localhost:5000/api/cart");
      setCart(res.data.items || []);
    } catch (err) {
      console.error("Lỗi lấy giỏ hàng:", err);
    }
    setLoading(false);
  };

  useEffect(() => {
    fetchCart();
  }, []);

  // Xóa sản phẩm
  const removeItem = async (productId) => {
    try {
      await axios.delete(`http://localhost:5000/api/cart/${productId}`);
      fetchCart();
    } catch (err) {
      console.error("Lỗi xóa sản phẩm:", err);
    }
  };

  // Tăng số lượng
  const increaseQuantity = async (productId) => {
    try {
      await axios.put(`http://localhost:5000/api/cart/increase/${productId}`);
      fetchCart();
    } catch (err) {
      console.error("Lỗi tăng số lượng:", err);
    }
  };

  // Giảm số lượng
  const decreaseQuantity = async (productId) => {
    try {
      await axios.put(`http://localhost:5000/api/cart/decrease/${productId}`);
      fetchCart();
    } catch (err) {
      console.error("Lỗi giảm số lượng:", err);
    }
  };

  const totalPrice = cart.reduce((sum, item) => sum + item.basePrice * item.quantity, 0);

  if (loading) return <p>Đang tải giỏ hàng...</p>;

  if (!cart.length)
    return (
      <p>
        Giỏ hàng trống. <Link to="/">Quay lại trang chủ</Link>
      </p>
    );

  return (
    <div className="cart-page">
      <h2>Giỏ Hàng</h2>
      <table>
        <thead>
          <tr>
            <th>Sản phẩm</th>
            <th>Giá</th>
            <th>Số lượng</th>
            <th>Thao tác</th>
          </tr>
        </thead>
        <tbody>
          {cart.map((item) => (
            <tr key={item._id}>
              <td>
                <img src={item.images?.[0]?.url} alt={item.name} width={50} />
                {item.name}
              </td>
              <td>{item.basePrice.toLocaleString()} ₫</td>
              <td>
                <button onClick={() => decreaseQuantity(item._id)}>-</button>
                {item.quantity}
                <button onClick={() => increaseQuantity(item._id)}>+</button>
              </td>
              <td>
                <button onClick={() => removeItem(item._id)}>Xóa</button>
              </td>
            </tr>
          ))}
          <tr>
            <td colSpan={4}>
              <b>Tổng: {totalPrice.toLocaleString()} ₫</b>
            </td>
          </tr>
        </tbody>
      </table>

      <button onClick={() => navigate("/checkout")}>Thanh toán</button>
    </div>
  );
};

export default CartPage;
